  `TimeFrom` time NOT NULL,
  `TimeTo` time DEFAULT NULL,
  `Result` varchar(200) DEFAULT NULL,
  `EmployeeID` int(11) NOT NULL,
  `Status` int(11) DEFAULT NULL,
  `VCrea` int(11) NOT NULL,
  `Dcrea` datetime DEFAULT NULL,
