/*Table structure for table `amtsproject_hist` */

DROP TABLE IF EXISTS `amtsproject_hist`;

CREATE TABLE `amtsproject_hist` (
  `recorded` datetime NOT NULL,
  `ProjectID` int(11) NOT NULL,
  `Name` varchar(45) NOT NULL,
  `Description` varchar(200) DEFAULT NULL,
  `ProjectManager` int(11) DEFAULT NULL,
  `StartDate` date NOT NULL,
  `EstimatedManHour` int(11) NOT NULL,
  `Status` int(11) NOT NULL,
  `Published` tinyint(1) NOT NULL,
  `version` varchar(45) DEFAULT NULL,
  `baseline` tinyint(1) DEFAULT NULL,
  `ContractAmount` varchar(45) DEFAULT NULL,
  `idcurrency` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`ProjectID`,`recorded`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

