  `TaskID` int(11) NOT NULL,
  `ActivityID` int(11) NOT NULL DEFAULT '999',
  `StartDate` date NOT NULL,
  `TimeFrom` time NOT NULL,
  `TimeTo` time DEFAULT NULL,
  `Result` varchar(200) DEFAULT NULL,
  `EmployeeID` int(11) NOT NULL,
  `Status` int(11) DEFAULT NULL,
  `VCrea` int(11) NOT NULL,
  `Dcrea` datetime DEFAULT NULL,
  PRIMARY KEY (`TaskID`,`ActivityID`,`EmployeeID`),
  KEY `Task_activity` (`ActivityID`),
  KEY `employeeid_mstusers` (`EmployeeID`),
  KEY `vcrea_mstusers` (`VCrea`),
  CONSTRAINT `employeeid_mstusers` FOREIGN KEY (`EmployeeID`) REFERENCES `phpfw_mstusers` (`vuserID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `Task_activity` FOREIGN KEY (`ActivityID`) REFERENCES `amtsactivity` (`ActivityID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `vcrea_mstusers` FOREIGN KEY (`VCrea`) REFERENCES `phpfw_mstusers` (`vuserID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

