/* Function  structure for function  `getCheckIn` */

/*!50003 DROP FUNCTION IF EXISTS `getCheckIn` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getCheckIn`(puserid int(11),pcheckdate date) RETURNS datetime
    DETERMINISTIC
BEGIN
	declare _checktime datetime;
	
	select timestamp(pcheckdate,time(c.checktime)) as checkin into _checktime
	FROM am_ts_checkinout c LEFT JOIN amts_v_userschedule s ON c.userid = s.userid
	WHERE c.userid = puserid
	AND DATE(c.checktime) = pcheckdate 
	AND getCheckType(c.userid,TIME(c.checktime)) = 'I'  
	ORDER BY TIME(c.checktime)DESC 
	LIMIT 1;
	
	return _checktime;
    END */$$
DELIMITER ;

/* Function  structure for function  `getCheckOut` */

/*!50003 DROP FUNCTION IF EXISTS `getCheckOut` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getCheckOut`(puserid int(11),pcheckdate date) RETURNS datetime
    DETERMINISTIC
BEGIN
	declare _checktime datetime;
	
	select c.checktime as checkout into _checktime
	FROM am_ts_checkinout c LEFT JOIN amts_v_userschedule s ON c.userid = s.userid
	WHERE c.userid = puserid
	AND c.checktime between timestamp(pcheckdate,s.checkouttime1) and timestamp(adddate(pcheckdate,interval 1 day),s.checkintime1)
	AND getCheckType(c.userid,TIME(c.checktime)) != 'I'  
	ORDER BY c.checktime DESC 
	LIMIT 1;
	
	return _checktime;
    END */$$
DELIMITER ;

/* Function  structure for function  `getCheckType` */

/*!50003 DROP FUNCTION IF EXISTS `getCheckType` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getCheckType`(puserid int(11),pchecktime time) RETURNS varchar(1) CHARSET latin1
    DETERMINISTIC
BEGIN
	declare _checktype varchar(1);
	declare _starttime time;
	declare _checkintime1 time;
	declare _checkintime2 time;
	declare _endtime time;
	declare _checkouttime1 time;
	declare _checkouttime2 time;
	
	select s.starttime,s.checkintime1,s.checkintime2,s.endtime,s.checkouttime1,s.checkouttime2 
	into _starttime,_checkintime1,_checkintime2,_endtime,_checkouttime1,_checkouttime2 
	from amts_v_userschedule s
	where s.userid = puserid
	limit 1;
	
	set _checktype  = "X";
	
	-- if statement here
	if pchecktime >  _checkintime1 then
		IF pchecktime <  _checkintime2 THEN
			set _checktype = "I";
		else 
			SET _checktype = "O";
		END IF;
	else 
		SET _checktype = "O";
	END IF;
		
	IF pchecktime >  _checkouttime1 THEN
		IF pchecktime <  _checkouttime2 THEN
			SET _checktype = "O";
		END IF;
	END IF;
	return _checktype;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `interval_between` */

/*!50003 DROP PROCEDURE IF EXISTS  `interval_between` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `interval_between`(startdate TIMESTAMP, enddate TIMESTAMP, interval_size VARCHAR(10), interval_value INT)
BEGIN
    DECLARE thisDate TIMESTAMP;
    SET thisDate = startdate;
 
    -- create the table for the dates if is not yet existing
    CREATE TEMPORARY TABLE IF NOT EXISTS time_intervals (
        interval_from TIMESTAMP
    );
 
    -- empty it from old data
    DELETE FROM time_intervals;
 
    REPEAT
        INSERT INTO time_intervals SELECT thisDate;
        SELECT
            CASE interval_size
                WHEN 'MICROSECOND' THEN TIMESTAMPadd(MICROSECOND, interval_value, thisDate)
                WHEN 'SECOND'      THEN TIMESTAMPadd(SECOND, interval_value, thisDate)
                WHEN 'MINUTE'      THEN TIMESTAMPadd(MINUTE, interval_value, thisDate)
                WHEN 'HOUR'        THEN TIMESTAMPadd(HOUR, interval_value, thisDate)
                WHEN 'DAY'         THEN TIMESTAMPadd(DAY, interval_value, thisDate)
                WHEN 'WEEK'        THEN TIMESTAMPadd(WEEK, interval_value, thisDate)
                WHEN 'MONTH'       THEN TIMESTAMPadd(MONTH, interval_value, thisDate)
                WHEN 'YEAR'        THEN TIMESTAMPadd(YEAR, interval_value, thisDate)
            END INTO thisDate;
    UNTIL thisDate >= enddate
    END REPEAT;
 
 END */$$
DELIMITER ;

/* Procedure structure for procedure `p_datebetween` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_datebetween` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_datebetween`(startdate timestamp, enddate timestamp, interval_size VARCHAR(10), interval_value INT)
BEGIN
    DECLARE thisDate timestamp;
    SET thisDate = startdate;
 
    -- create the table for the dates if is not yet existing
    CREATE TEMPORARY TABLE IF NOT EXISTS t_datebetween (
        _date date
    );
 
    -- empty it from old data
    DELETE FROM t_datebetween;
 
    REPEAT
        INSERT INTO t_datebetween SELECT thisDate;
        SELECT
            CASE interval_size
                WHEN 'MICROSECOND' THEN timestampadd(MICROSECOND, interval_value, thisDate)
                WHEN 'SECOND'      THEN TIMESTAMPadd(SECOND, interval_value, thisDate)
                WHEN 'MINUTE'      THEN TIMESTAMPadd(MINUTE, interval_value, thisDate)
                WHEN 'HOUR'        THEN TIMESTAMPadd(HOUR, interval_value, thisDate)
                WHEN 'DAY'         THEN TIMESTAMPadd(DAY, interval_value, thisDate)
                WHEN 'WEEK'        THEN TIMESTAMPadd(WEEK, interval_value, thisDate)
                WHEN 'MONTH'       THEN TIMESTAMPadd(MONTH, interval_value, thisDate)
                WHEN 'YEAR'        THEN TIMESTAMPadd(YEAR, interval_value, thisDate)
            END INTO thisDate;
    UNTIL thisDate >= enddate
    END REPEAT;
 
 END */$$
DELIMITER ;

/* Procedure structure for procedure `testloop` */

/*!50003 DROP PROCEDURE IF EXISTS  `testloop` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `testloop`(out d1 date,out d2 date)
    DETERMINISTIC
BEGIN
	DECLARE date1,date2 DATE;
	SET date1 = '2013-01-01';
	SET date2 = '2013-01-31';
	
	label1:LOOP
	IF date1 <= date2 THEN 
		SET date1 = DATE_ADD(date1,INTERVAL 1 DAY);
		ITERATE label1;
	END IF;
	LEAVE label1;
	END LOOP label1;
	
	SET @d1 = date1;
	SET @d2 = date2;
	
    END */$$
DELIMITER ;

